import React from "react";
import "./App.css";
import Header from "./Header";
import Product from "./Product";

function App() {
    return (
        <div>
            <Header/>
            <div>
            <Product name="Levis Jeans" price="2000"/>
            <Product name="Samsung A31" price="21000"/>
            </div>

        </div>
    );
}

export default App;
